import React from 'react'
import axios from "axios";

import {Link} from "react-router-dom"
import { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';

function MealPlans() {

    const [listOfMealPlans, setlistOfMealPlans] = useState([]);
    const [listOfRecipes, setlistOfRecipes] = useState([]);
    const email = sessionStorage.getItem("email");
    let id;
    const navigate = useNavigate();

    useEffect(() => {
        axios.get(`http://localhost:3001/authentication/${email}`).then((response) => {
            id = response.data;
        });
        axios.get(`http://localhost:3001/mealplans/all/${id}`).then((response) => {
            console.log(response.data);
  
            setlistOfMealPlans(response.data);
          //console.log(response.data);
        });
      }, []);

  return (
    <div className="App">
        <Link to="/">Back</Link>
        <div className='mealPlans'>
            {listOfMealPlans.map((mealPlan) => { 
            return (
            <div className="mealPlan" >
                <div className='name'>{mealPlan.name}</div> 
                <div className='body'>
                    <div className='type'>Scope: {mealPlan.type}</div>
                    {/* <div className='recipes'>
                        Recipes: {Object.entries(mealPlan.recipes).map(([key, value]) => (
                            <span key={key}>
                            {key}: {value}{', '}
                            </span>
                        ))}
                    </div> */}

                </div>
            </div>
            )
        })}
      </div>
    </div>
  )
}

export default MealPlans
